'use strict';

angular.module('app.tata',[ 'ngRoute', 'ngResource', 'angularFileUpload'])

.config(['$routeProvider', function($routeProvider) {
  $routeProvider.when('/tata', {
    templateUrl: 'tata/tata.html',
    controller: 'TataCtrl'
  });
}])

.controller('TataCtrl', [ '$rootScope', '$scope','$uibModal', 'Tata', 'FileUploader',
          				function($rootScope, $scope, $uibModal, Tata, FileUploader) {
	
	$scope.showNewTataForm = false;
	$scope.showTataDetails = false;
	$scope.agencyId = "tataApp"; 	// TODO: pass the parameter from configuration file
	$scope.mailPattern=/^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
	
	$scope.onErrorSrc = "images/empty_avatar.png";
	
	$scope.itaLang = "italiano";
	$scope.engLang = "inglese";
	$scope.gerLang = "tedesco";
	$scope.fraLang = "francese";
	$scope.spaLang = "spagnolo";
	
	var imageBase64 = "";
	
	$scope.trueVal = true;
	$scope.falseVal = false;
	$scope.tata = null;
	
	$scope.uploader = new FileUploader({
		queueLimit: 1,
		removeAfterUpload: true
	});	// file upload element
	
	$scope.tataconf = {
		profileimage: {
			required : true
		},
		name: {
			required : true
		},
		surname: {
			required: true
		},
		birthdate: {
			required: true
		},
		email: {
			required: true
		},
		address: {
			required: true
		},
		city: {
			required: true
		},
		languages: {
			required: true
		},
		description: {
			required: true
		},
		updates: {
			required: true
		},
		carowner: {
			required: true
		}
	};
	
	// Date picker functions -------------------------------------------------------------------------------------------------------------------------
	
	$scope.today = function(date) {
	    $scope.tata.birthdate = new Date(date);
	};
	//$scope.today();

	$scope.clear = function() {
	    $scope.tata.birthdate = null;
	};

	$scope.inlineOptions = {
	    customClass: getDayClass,
	    minDate: new Date(),
	    showWeeks: true
	};

	$scope.dateOptions = {
		datepickerMode:"year",	// default open to year
	    formatYear: 'yyyy',
	    //dateDisabled: disabled,
	    maxDate: new Date(2020, 5, 22),
	    minDate: new Date(),
	    startingDay: 1,
	    showWeeks: false
	};

	// Disable weekend selection
	function disabled(data) {
	    var date = data.date,
	    mode = data.mode;
	    return mode === 'day' && (date.getDay() === 0 || date.getDay() === 6);
	}

	$scope.toggleMin = function() {
	    $scope.inlineOptions.minDate = $scope.inlineOptions.minDate ? null : new Date();
	    $scope.dateOptions.minDate = $scope.inlineOptions.minDate;
	};
	$scope.toggleMin();

	$scope.open1 = function() {
	    $scope.popup1.opened = true;
	};

	$scope.setDate = function(year, month, day) {
	    $scope.dt = new Date(year, month, day);
	};

	$scope.format = 'shortDate';
	$scope.altInputFormats = ['M!/d!/yyyy'];

	$scope.popup1 = {
	    opened: false
	};

	var tomorrow = new Date();
	tomorrow.setDate(tomorrow.getDate() + 1);
	var afterTomorrow = new Date();
	afterTomorrow.setDate(tomorrow.getDate() + 1);
	$scope.events = [
	    {
	    	date: tomorrow,
	    	status: 'full'
	    },
	    {
	    	date: afterTomorrow,
	    	status: 'partially'
	    }
	];

	function getDayClass(data) {
	    var date = data.date,
	    mode = data.mode;
	    if (mode === 'day') {
	    	var dayToCheck = new Date(date).setHours(0,0,0,0);
	    	
	    	for (var i = 0; i < $scope.events.length; i++) {
	    		var currentDay = new Date($scope.events[i].date).setHours(0,0,0,0);

	    		if (dayToCheck === currentDay) {
	    			return $scope.events[i].status;
	    		}
	    	}
	    }
	    return '';
	}
	
	// ---------------------------------------------------------------------------------------------------------------------------------------------
	
	// method used to retrieve the tata list
	$scope.getTataList = function(){
		$scope.tatalist = Tata.list();
	}
	
	// method used to show the new tata input form
	$scope.newTata = function(){
		$scope.isInit = true;
		$scope.tata = new Tata();
		$scope.uploader.clearQueue();
		$scope.tata.boollanguage = [false,false,false,false,false];
		$scope.tata.languages = [];
		$scope.today("1/1/1970 00:00:00");	// init birthday value
		$scope.showNewTataForm = true;
	};
	
	$scope.editTata = function(tata){
		$scope.isInit = true;
		$scope.tata = tata;	//here I have to correct some data
		$scope.tata.boollanguage = $scope.fromLanguagesToCheck($scope.tata.languages);
		//var blob = new Blob([imageBase64], {type: 'text/html'});
		//var file = new File([blob], 'img/imageFileName.png', {type: 'image/png'});
		var completeBase64 = "data: image/png;base64," + imageBase64;
		var file = $scope.dataURItoBlob(completeBase64);
		$scope.uploader.addToQueue(file);
		
		$scope.showTataDetails = false;
		$scope.showEditTataForm = true;
	}
	
	// method used to get the check languages value from the language string list
	$scope.fromLanguagesToCheck = function(languageStrings){
		var boolValues = [false, false, false, false, false];
		for(var i = 0; i < languageStrings.length; i++){
			switch(languageStrings[i]){
				case $scope.itaLang:
					boolValues[0] = true;
					break;
				case $scope.engLang:
					boolValues[1] = true;
					break;
				case $scope.gerLang:
					boolValues[2] = true;
					break;
				case $scope.fraLang:
					boolValues[3] = true;
					break;
				case $scope.spaLang:
					boolValues[4] = true;
					break;
				default: break;	
			}
		}
		return boolValues;
	};
	
	// method used to create a new tata with the data passed in new tata form
	$scope.createTata = function(form, tata){
		$scope.isInit = false;
		if(form.$valid){
			if(($scope.tataconf.profileimage.required && $scope.uploader.queue == null) || ($scope.tataconf.profileimage.required && $scope.uploader.queue.length == 0)){
				$scope.showNoProfileError = true;
			} else {
				$scope.showNoProfileError = false;
				// here I load the image
				var item = null;
				var pngUrl = null;
				for(var i = 0; i < $scope.uploader.queue.length; i++){
					item = $scope.uploader.queue[i];
				}
				var canvas = angular.element(document).find('canvas');
				var type = item.file.type;
				pngUrl = canvas[0].toDataURL(type);	// I retrieve the data-url from canvas;
				// correctLanguages form bool to string
				for(var i = 0; i < tata.boollanguage.length; i++){
					if(tata.boollanguage[i]){
						switch(i){
							case 0:
								tata.languages.push($scope.itaLang);
								break;
							case 1:
								tata.languages.push($scope.engLang);
								break;
							case 2:
								tata.languages.push($scope.gerLang);
								break;
							case 3:
								tata.languages.push($scope.fraLang);
								break;
							case 4:
								tata.languages.push($scope.spaLang);
								break;	
							default:
								break;
						}
					}
				}
				var correctedtata = {
					//profile: pngUrl,
					name: tata.name,
					surname: tata.surname,
					birthdate: $scope.castDateToMillis(tata.birthdate),
					email: tata.email,
					address: tata.address,
					city: tata.city,
					languages: tata.languages,
					carOwner: tata.carOwner,
					agencyId: $scope.agencyId,
					description: tata.description,
					updates: tata.updates
				};
				
				$scope.corrtata = new Tata(correctedtata);
				
				console.log(JSON.stringify($scope.corrtata));
			    $scope.corrtata.$save(function() {
			       	console.log('Saved tata');
			       	$scope.tatalist = Tata.list();
			    });
			        
				$scope.showNewTataForm = false;
			}
		}
	};
	
	$scope.updateTata = function(form, tata){
		$scope.isInit = false;
		if(form.$valid){
			// correctLanguages form bool to string
			for(var i = 0; i < tata.boollanguage.length; i++){
				if(tata.boollanguage[i]){
					switch(i){
						case 0:
							if(!$scope.listContains(tata.languages, $scope.itaLang)){
								tata.languages.push($scope.itaLang);
							}
							break;
						case 1:
							if(!$scope.listContains(tata.languages, $scope.engLang)){
								tata.languages.push($scope.engLang);
							}
							break;
						case 2:
							if(!$scope.listContains(tata.languages, $scope.gerLang)){
								tata.languages.push($scope.gerLang);
							}
							break;
						case 3:
							if(!$scope.listContains(tata.languages, $scope.fraLang)){
								tata.languages.push($scope.fraLang);
							}
							break;
						case 4:
							if(!$scope.listContains(tata.languages, $scope.spaLang)){
								tata.languages.push($scope.spaLang);
							}
							break;	
						default:
							break;
					}
				}
			}
			var correctedtata = {
				id: tata.id,
				name: tata.name,
				surname: tata.surname,
				birthdate: $scope.castDateToMillis(tata.birthdate),
				email: tata.email,
				address: tata.address,
				city: tata.city,
				languages: tata.languages,
				carOwner: tata.carOwner,
				agencyId: $scope.agencyId,
				description: tata.description,
				updates: tata.updates
			};
			
			$scope.corrtata = new Tata(correctedtata);
			
			console.log(JSON.stringify($scope.corrtata));
	        $scope.corrtata.$save(function() {
	        	console.log('Updated tata');
	        	$scope.tatalist = Tata.list();
	        });
			
			$scope.showEditTataForm = false;
			$scope.showTataDetails = false;
		}
	};
	
	$scope.deleteTata = function(tata){
		Tata.deleteTata({tid: tata.id});
		console.log("Tata " + tata.name + " successfully delected");
    	$scope.tatalist = Tata.list();
    	$scope.showTataDetails = false;
	};
	
	$scope.listContains = function(list, item){
		return (-1 !== list.indexOf(item));
	};
	
	$scope.showTata = function(tata){
		$scope.showTataDetails = true;
		$scope.vtata = tata;
		//TODO: for test to be removed in prod
		$scope.vtata.profileImage = "data:image/png;base64," + imageBase64;
	};
	
	$scope.hideTata = function(){
		$scope.showTataDetails = false;
	};
	
	$scope.getStrings = function(list) {
		var strings = "";
		for(var i = 0; i < list.length; i++){
			strings += list[i] + ", ";
		}
		return strings.substring(0, strings.length-2);
	}
	
	// method used to close the new tata input form without create a new tata
	$scope.closeNewTataView = function(){
		$scope.tata = null;
		$scope.isInit = true;
		$scope.showNewTataForm = false;
	};
	
	// method used to close the edit tata input form without edit ad existing tata
	$scope.closeEditTataView = function(){
		$scope.isInit = false;
		$scope.showEditTataForm = false;
		$scope.showTataDetails = true;
	}
	
	$scope.someSelectedLang = function(languages){
		var somes = false;
		if(languages){
			for(var i = 0; i < languages.length; i++){
				if(languages[i]){
					somes = true;
				}
			}
		}
		return somes;
	};
	
	// method castDateToMillis: used to cast a string date in a millisecond value (millis from 1-1-1970)
	$scope.castDateToMillis = function(date){
		//var date = new Date(date + " 00:00:00");
		return date.getTime();
	};
	
	/**
	 * Converts data uri to Blob. Necessary for uploading.
	 * @see
	 *   http://stackoverflow.com/questions/4998908/convert-data-uri-to-file-then-append-to-formdata
	 * @param  {String} dataURI
	 * @return {Blob}
	 */
	$scope.dataURItoBlob = function(dataURI) {
	    var binary = atob(dataURI.split(',')[1]);
	    var mimeString = dataURI.split(',')[0].split(':')[1].split(';')[0];
	    var array = [];
	    for(var i = 0; i < binary.length; i++) {
	        array.push(binary.charCodeAt(i));
	    }
	    //return new Blob([new Uint8Array(array)], {type: mimeString});
	    return new File([new Blob([new Uint8Array(array)], {type: mimeString})], 'profileAvatar.png', {type: mimeString})
	};
	
	
}])

.factory('Tata', [ '$resource', function($resource) {
	return $resource('console/api/agency/:id/tata/:tid', {
		id : "tataApp",
		tid: '@id'
	}, {
		list : {
			isArray : true,
			method : 'get',
			transformResponse : function(data, headers) {
				return JSON.parse(data).content;
			}
		},
		deleteTata : {
			method : 'delete'
		}
	});
} ])

.directive('onErrorSrc', function() {
    return {
        link: function(scope, element, attrs) {
          element.bind('error', function() {
            if (attrs.src != attrs.onErrorSrc) {
              attrs.$set('src', attrs.onErrorSrc);
            }
          });
        }
    }
})
.directive('ngThumb', ['$window', function($window) {
    var helper = {
        support: !!($window.FileReader && $window.CanvasRenderingContext2D),
        isFile: function(item) {
            return angular.isObject(item) && item instanceof $window.File;
        },
        isImage: function(file) {
            var type =  '|' + file.type.slice(file.type.lastIndexOf('/') + 1) + '|';
            return '|jpg|png|jpeg|bmp|gif|'.indexOf(type) !== -1;
        }
    };

    return {
        restrict: 'A',
        template: '<canvas/>',
        link: function(scope, element, attributes) {
            if (!helper.support) return;

            var params = scope.$eval(attributes.ngThumb);

            if (!helper.isFile(params.file)) return;
            if (!helper.isImage(params.file)) return;

            var canvas = element.find('canvas');
            var reader = new FileReader();

            reader.onload = onLoadFile;
            reader.readAsDataURL(params.file);

            function onLoadFile(event) {
                var img = new Image();
                img.onload = onLoadImage;
                img.src = event.target.result;
            }

            function onLoadImage() {
                var width = params.width || this.width / this.height * params.height;
                var height = params.height || this.height / this.width * params.width;
                canvas.attr({ width: width, height: height });
                canvas[0].getContext('2d').drawImage(this, 0, 0, width, height);
            }
        }
    };
}]);
